pragma solidity 0.8.28;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./Interfaces/IRouter.sol";
import "./Interfaces/IFactory.sol";

contract Rezor is IERC20, Ownable {

    uint256 private _totalSupply = 100 * 10**9 * 10**9;
    uint256 public constant swapTokensAtUSDCAmount = 250 ether;                                 // 250 USDC    
    uint256 public buyTax = 20;
    uint256 public sellTax = 20;
    uint256 public taxCollected;                                                          

    bool private transient swapping;
    bool public airdropClosed;
    uint8 private constant _decimals = 9;

    address public constant developmentAddress = 0xfA717eABA5bA7b2C752E12BaF4ac978AaD438F79;
    address public immutable USDC;

    IRouter public router;
    IRouter public router2;

    string private constant _name = "Rezor";
    string private constant _symbol = "RZR";

    mapping(address account => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;
    mapping(address => bool) private _isPair;
    mapping(address => bool) private _isBot;
    mapping(address => bool) public canAirdrop;
    mapping(address => bool) public isAirdropped;

    event FeesChanged();
    event BatchAirDropped(string _batchId);
    event AddressesMarketAsBot(address[] accounts);
    event AirdropControlSet(address[] _addr, bool[] _access);

    modifier lockTheSwap {
        swapping = true;
        _;
        swapping = false;
    }

    modifier hasAirdropControl(address _addr) {
        require(canAirdrop[_addr], "Rezor::No access");
        _;
    }

    constructor (address routerAddress, address owner_, address _usdc, address router2_) Ownable(owner_) {
        require(routerAddress != address(0) && owner_ != address(0) && _usdc != address(0) && router2_!= address(0), "Rezor::Invalid address");
        IRouter _router = IRouter(routerAddress);
        IRouter _router2 = IRouter(router2_);

        address _pair = IFactory(_router.factory())
            .createPair(address(this), _router.WETH());

        router = _router;
        USDC = _usdc;
        router2 = _router2;
        _isPair[_pair] = true;

        _balances[owner_] = _totalSupply;
        emit Transfer(address(0), owner_, _totalSupply);
    }

    function name() public pure returns (string memory) {
        return _name;
    }
    function symbol() public pure returns (string memory) {
        return _symbol;
    }
    function decimals() public pure returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view virtual returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view virtual returns (uint256) {
        return _balances[account];
    }

    function transfer(address recipient, uint256 amount) public override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(address _owner, address spender) public view override returns (uint256) {
        return _allowances[_owner][spender];
    }

    function approve(address spender, uint256 amount) public override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public virtual override returns (bool) {
        uint256 currentAllowance = _allowances[sender][_msgSender()];
        require(currentAllowance >= amount, "ERC20: transfer amount exceeds allowance");

        _transfer(sender, recipient, amount);
        _approve(sender, _msgSender(), currentAllowance - amount);

        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender] + addedValue);
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool) {
        uint256 currentAllowance = _allowances[_msgSender()][spender];
        require(currentAllowance >= subtractedValue, "ERC20: decreased allowance below zero");
        _approve(_msgSender(), spender, currentAllowance - subtractedValue);

        return true;
    }

    function isPair(address account) public view returns(bool) {
        return _isPair[account];
    }

    function _approve(address _owner, address spender, uint256 amount) private {
        require(_owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");
        _allowances[_owner][spender] = amount;
        emit Approval(_owner, spender, amount);
    }


    function _transfer(address from, address to, uint256 amount) private {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(amount > 0, "Zero amount");
        require(amount <= balanceOf(from),"Insufficient balance");
        require(!_isBot[from] && !_isBot[to], "Rezor::You are a bot");

        if(!swapping) {
            // sell
            if(_isPair[to]) _tokenTransfer(from, to, amount, 1);
            // buy
            else if(_isPair[from]) _tokenTransfer(from, to, amount, 2);
            // transfer
            else _tokenTransfer(from, to, amount, 0);
        } else {
            _tokenTransfer(from, to, amount, 0);
        }

        if(!swapping && !_isPair[from] && !_isPair[to] && from != address(router) && from!= address(router2) && taxCollected > 0) {
            address[] memory path = new address[](2);
                path[0] = USDC;
                path[1] = router.WETH();
            uint _amountNative = router.getAmountsOut(swapTokensAtUSDCAmount, path)[1];
                path[0] = router2.WETH();
                path[1] = address(this);
            uint _amount = router2.getAmountsOut(_amountNative, path)[1];
            if(_amount <= taxCollected && _amount > 0) swapTokensForETH(_amount);
        }

    }

    function _tokenTransfer(address sender, address recipient, uint256 _amount, uint8 takeFee) private {
        if(takeFee == 0) {
          _standardTransfer(sender, recipient, _amount);
        } else if(takeFee == 1){
            _sellTransfer(sender, recipient, _amount);
        } else if(takeFee == 2) {
            _buyTransfer(sender, recipient, _amount);
        }
    }

    function _standardTransfer(address spender, address receiver, uint256 _amount) private {
        _balances[spender] -= _amount;
        _balances[receiver] += _amount;
        emit Transfer(spender, receiver, _amount);
    }

    function _sellTransfer(address spender, address receiver, uint256 _amount) private {
        uint256 taxAmount = _amount * sellTax / 1000;
        uint256 amount = _amount - taxAmount;

        _balances[spender] -= _amount;

        if(taxAmount > 0) {
            taxCollected += taxAmount;
            _balances[address(this)] += taxAmount;
            emit Transfer(spender, address(this), taxAmount);
        }

        _balances[receiver] += amount;
        emit Transfer(spender, receiver, amount);
    }

    function _buyTransfer(address spender, address receiver, uint256 _amount) private {
        uint256 taxAmount = _amount * buyTax / 1000;
        uint256 amount = _amount - taxAmount;

        _balances[spender] -= _amount;

        if(taxAmount > 0) {
            taxCollected += taxAmount;
            _balances[address(this)] += taxAmount;
            emit Transfer(spender, address(this), taxAmount);
        }

        _balances[receiver] += amount;
        emit Transfer(spender, receiver, amount);
    }

    function swapTokensForETH(uint256 tokenAmount) private lockTheSwap {
        // generate the uniswap pair path of token -> weth
        address[] memory path = new address[](2);
                path[0] = address(this);
                path[1] = router.WETH();

        _approve(address(this), address(router2), tokenAmount);

        uint256 preBalance = address(this).balance;
        // make the swap
        router2.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of ETH
            path,
            address(this),
            block.timestamp
        );

        uint256 taxInETH = address(this).balance - preBalance;

        (bool success, ) = payable(developmentAddress).call{value: taxInETH}("");
        require(success, 'Rezor::ETH_TRANSFER_FAILED');
        taxCollected -= tokenAmount;
    }

    function setBuyTaxes(uint256 _buyTax) public onlyOwner {
        require(_buyTax < 21, "Rezor::Max 2% tax allowed");
        buyTax = _buyTax;
        emit FeesChanged();
    }

    function setSellTaxes(uint256 _selltax) public onlyOwner {
        require(_selltax < 21, "Rezor::Max 2% tax allowed");
        sellTax = _selltax;
        emit FeesChanged();
    }

    function bulkAntiBot(address[] memory accounts, bool state) external onlyOwner {
        require(accounts.length <= 100, "Rezor::Invalid");
        for(uint256 i = 0; i < accounts.length; i++){
            _isBot[accounts[i]] = state;
        }

        emit AddressesMarketAsBot(accounts);
    }

    function airdropTokens(address[] memory recipients, uint256[] memory amounts, string memory _batchId) external hasAirdropControl(msg.sender) {
        require(!airdropClosed, "Rezor::Airdrop closed");
        require(recipients.length == amounts.length,"Rezor::Invalid size");
         address sender = owner();

         for(uint256 i; i<recipients.length; i++) {
            address recipient = recipients[i];

            require(balanceOf(sender) >= amounts[i], "Rezor::Insufficient owner balance");
            if(isAirdropped[recipient]) revert("Rezor::Already airdropped");

            isAirdropped[recipient] = true;

            _balances[sender] -= amounts[i];
            _balances[recipient] += amounts[i];
            emit Transfer(sender, recipient, amounts[i]);
         }

        emit BatchAirDropped(_batchId);

    }

    function setAirdropControl(address[] memory _addr, bool[] memory _access) external onlyOwner {
        require(_addr.length == _access.length, "Rezor::Different length inputs");
        for(uint i = 0; i< _addr.length; i++) {
            canAirdrop[_addr[i]] = _access[i];
        }

        emit AirdropControlSet(_addr, _access);
    }

    function closeAirdrop() external onlyOwner {
        require(!airdropClosed, "Rezor::Already closed");
        airdropClosed = true;
    }

    function isBot(address account) public view returns(bool){
        return _isBot[account];
    }

    function setRouterAndPair(address newRouter, address router2_, address newPair, bool isActive) external onlyOwner {
        require(newRouter != address(0) && newPair != address(0) && router2_ != address(0), "Rezor::Invalid address");
        router = IRouter(newRouter);
        router2 = IRouter(router2_);
        _isPair[newPair] = isActive;
    }

    receive() external payable {
    }

}"
    }
  },
  "settings": {
    "optimizer": {
      "enabled": true,
      "runs": 100000000
    },
    "evmVersion": "cancun",
    "outputSelection": {
      "*": {
        "*": [
          "evm.bytecode",
          "evm.deployedBytecode",
          "devdoc",
          "userdoc",
          "metadata",
          "abi"
        ]
      }
    },
    "libraries": {}
  }
}}

